import React, { useState } from "react";

const ChatMessage = (props) => {
    const [id] = useState(props.id);
    const [text] = useState(props.text)
    const [time] = useState(props.time)
    const [user] = useState(props.user)


    return (
        <li>
            {time},{user},{text}
        </li>
    );
}

export default ChatMessage;
